import React from 'react';

class Home extends React.Component {
  render() {
    if(this.props.data){
      var name        = this.props.data.name;
      var occupation  = this.props.data.occupation;
      var bio         = this.props.data.bio;
      var profile_img = this.props.data.bio;
    }

    return (
        <section id="Home" className="segment space-huge bg-pink">
            <div className="container">
                <div className="row">
                    <div className="col-md-12 text-center">{profile_img}
                      <img className="img-fluid profile-img" src={process.env.PUBLIC_URL + '/Assets/images/Img_profile.png'} alt="{name}"></img>
                    </div>
                </div>
                <div className="row">
                  <div className="col-md-12 text-center">
                    <h3 className="text-uppercase profile-name">{name}</h3>
                    <p className="profile-position font-italic accent"><strong>{occupation}</strong></p>
                    <p className="profile-address font-italic">094-553-8085  <a href="mailto:wpakasame@gmail.com" className="accent">wpakasame@gmail.com</a>  Bangkok, Thailand</p>
                  </div>
                </div>
            </div>
        </section>
      );
    }
  }
export default Home;
